s = ""

posibles = []

i = 1
p=0
while i <= len(s):
    for x in range(0,len(s)-i+1):
        sub = s[x:x+i]
        if sub not in posibles:
            #print(sub)
            posibles.append(sub)
            p+=1
    print("{} - {}".format(i,p))
    posibles = []
    i+=1

#print(posibles)
print(p)